import React from "react";
import { Link } from "react-router-dom";

function Navbar() {
    return (
        <div>
            <ul>
                <li>
                    <Link to="#">Dogs</Link>
                </li>
                <li>
                    <Link to="#">Cats</Link>
                </li>
                <li>
                    <Link to="#">Sheep</Link>
                </li>
                <li>
                    <Link to="#">Goats</Link>
                </li>
            </ul>
        </div>
    );
};

export default Navbar;
